import React, { useState, useEffect } from 'react';

function List(props) {
    var idcount = 0;
    return (
        <>
        {props.items.map((movie, index)=> (
          <div id={idcount++} className="items">
            <img src={movie.Poster} alt='movie' className='movie-image'></img>
          </div>
        ))}
      </>
    )
}

export default List;
